import React, { useState } from 'react';
import './App.css';
import Autorizar from './components/Autorizar';
import Login from './components/Login';

export default function App() {
  const [screen, setScreen] = useState('home'); // 'home' | 'login'

  if (screen === 'login') {
    return <Login onCancel={() => setScreen('home')} />;
  }
  return <Autorizar onLogin={() => setScreen('login')} />;
}
